{"operationName":"SeoLandingRoleSearchPage","variables":{"page":1,"role":"software-engineer"},"query":"
        query SeoLandingRoleSearchPage($role: String!, $page: Int!) {
            talent {
                seoLandingPageJobSearchResults(role: $role, page: $page) {
                    totalJobCount
                    totalStartupCount
                    perPage
                    pageCount
                    startups {
                        id
                        name
                        slug
                        logoUrl
                        companyUrl
                        companySize
                        highConcept
                        badges {
                            id
                            label
                            tooltip
                            rating
                        }
                        highlightedJobListings {
                            id
                            slug
                            title
                        }
                        marketTaggings {
                            id
                            slug
                            displayName
                        }
                    }
                }
            }
        }
    "}

